<p>线程是程序中的一个执行单元，每个线程都有自己的程序计数器、栈和局部变量。多线程允许程序在同一时间执行多个操作，而这些操作共享同一个内存空间。</p>
<blockquote>
<p>联想操作系统中线程PCB</p>
